INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (0, "リリ", 1, 321, 40011, 125801, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 2, 1, 1, 24001);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (0, "クリア", 2, 322, 40011, 126001, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 2, 1, 1, 24001);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (0, "プレシア", 3, 323, 40011, 126101, "んーと。\nこれ、あげる。\nはい", 2, 1, 1, 24001);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (0, "リリ", 4, 324, 40011, 125801, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 2, 1, 2, 24001);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (0, "クリア", 5, 325, 40011, 126001, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 2, 1, 2, 24001);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (0, "プレシア", 6, 326, 40011, 126101, "お兄。\nきてくれて、うれしい", 2, 1, 2, 24001);
